import "./error.css"
import image from "./Screenshot 2022-10-30 at 7.07.42 PM.png"


function NotFound() {
    return (
        <div className="notFoundpage">
          <img src={image} alt="err" height={100} width={100} /><br></br> 
            <h4> 404 Error, Page Not Found </h4> 
        </div>     
    );
}
 
export default NotFound;
